import React from 'react';
import '../../css/tweets/TweetText.css';

class TweetText extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {

        return (
            <div className="TweetTextBox">
                <p className="TweetTextContent">{this.props.tweet_text}</p>
            </div>

            );
    }
}

export default TweetText;
